syntax = "proto3";

package Abs.CommonCore.Contracts.Proto.Cloud.Waypoints.Ecdis;

import "google/protobuf/timestamp.proto";

message WaypointsBlobReceived
{
    optional string originalUrl = 1;
    optional string permanentUrl = 2;
    optional string type = 3;
    optional int64 size = 4;
    optional google.protobuf.Timestamp fileReceivedDateTime = 5;
    optional string ccTenantId = 6;
    optional string partnerName = 7;
}